import React from 'react';
import { Box, Text } from '@chakra-ui/react';

const Footer = props => {
  return (
    <Box marginX="auto" w="100%" {...props} justifyContent="center">
      <Box w="100%" mx="auto">
        <iframe
          src="https://open.spotify.com/embed/track/74kCarkFBzXYXNkkYJIsG0"
          width="300px"
          height="80px"
          frameborder="0"
          allowtransparency="true"
          allow="encrypted-media"
        />
      </Box>
      <Box textAlign="center" fontSize="xs" pt={2} fontWeight="300">
        <Text>Designed & developed by Sumant Guha</Text>
        <Text>&copy; Crafted with ❤️ in Seattle</Text>
      </Box>
    </Box>
  );
};

export default Footer;
